package com.br.contactfetchapp.data.modelimport android.os.Parcelimport android.os.Parcelabledata class RandomUser(    val fullName: String,    val gender: String,    val location: String,    val email: String,    val picture: String,    val cell: String,    val dob: String,    val nat: String,    val phone: String,    val registered: String,) : Parcelable {    constructor(parcel: Parcel) : this(        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",        parcel.readString() ?: "",    )    override fun writeToParcel(parcel: Parcel, flags: Int) {        parcel.writeString(fullName)        parcel.writeString(gender)        parcel.writeString(location)        parcel.writeString(email)        parcel.writeString(picture)        parcel.writeString(cell)        parcel.writeString(dob)        parcel.writeString(nat)        parcel.writeString(phone)        parcel.writeString(registered)    }    override fun describeContents(): Int {        return 0    }    companion object CREATOR : Parcelable.Creator<RandomUser> {        override fun createFromParcel(parcel: Parcel): RandomUser {            return RandomUser(parcel)        }        override fun newArray(size: Int): Array<RandomUser?> {            return arrayOfNulls(size)        }    }}